import React from 'react';
import Curriculo from './curriculo';
import Navbar from './Navbar';

const CurriculoModel = () => {
    return (
        <div className='bg-[#656565] flex flex-1 flex-col   h-full w-screen'>
            <Navbar></Navbar>
            <div className='flex flex-1 h-full w-screen    content-center'>

            <Curriculo></Curriculo>
            </div>
        </div>
    );
}

export default CurriculoModel;
